import React, { Component } from 'react'
import PropTypes from 'prop-types';
import Header from './Header'

export default class Home extends Component {
  render() {
    return (
        <main>
          <Header />
        </main>
    )
  }
}

Home.propTypes = {
  history: PropTypes.shape().isRequired,
};
